webpackJsonp([0xf53ff4c5dc6f7800],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-joins.json":function(n,s){n.exports={data:{markdownRemark:{html:'<h2>SQL Joins</h2>\n<h3>Example of use</h3>\n<p>For this guide we’ll discuss the JOIN section of the SQL statement.</p>\n<h3>SQL syntax with focus on Join</h3>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> col1<span class="token punctuation">,</span> col2<span class="token punctuation">,</span> col3<span class="token punctuation">,</span> etc<span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span>\n<span class="token keyword">FROM</span>  tableNameOne <span class="token keyword">AS</span> <span class="token number">a</span>\n<span class="token keyword">JOIN</span> tableNameTwo <span class="token keyword">AS</span> <span class="token number">b</span> <span class="token keyword">ON</span> <span class="token number">a</span><span class="token punctuation">.</span>primeKey <span class="token operator">=</span> <span class="token number">b</span><span class="token punctuation">.</span>primeKey \netc<span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span>\n</code></pre>\n      </div>\n<p>The JOIN statement could be just JOIN or INNER JOIN, which are the same, or LEFT JOIN (described below). </p>\n<h3>Different Types of JOINs</h3>\n<ul>\n<li>\n<p>(INNER) JOIN</p>\n<ul>\n<li>Return records that have matching values in both tables</li>\n</ul>\n</li>\n<li>\n<p>LEFT (OUTER) JOIN</p>\n<ul>\n<li>Return all records from the left table, and the matched records from the right table</li>\n</ul>\n</li>\n<li>\n<p>RIGHT (OUTER) JOIN</p>\n<ul>\n<li>Return all records from the right table, and the matched records from the left table</li>\n</ul>\n</li>\n<li>\n<p>FULL (OUTER) JOIN</p>\n<ul>\n<li>Return all records when there is a match in either left or right table</li>\n</ul>\n</li>\n</ul>\n<h3>Join</h3>\n<p>The student table will be in the FROM clause so it will be a starting or LEFT table.</p>\n<p>We’ll JOIN this to the student contact table or RIGHT table.</p>\n<p>You’ll see that all of the students appear that are also in the contact table.</p>\n<p>As shown in the tables below, studentID 9 is in the student table but NOT in the contact table so won’t appear in a join.</p>\n<p>SQL Statement</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>FullName<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>programOfStudy<span class="token punctuation">,</span>\n<span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>phone<span class="token operator">-</span>cell<span class="token punctuation">`</span><span class="token punctuation">,</span> <span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>US<span class="token operator">-</span>zipcode<span class="token punctuation">`</span>\n<span class="token keyword">FROM</span> student <span class="token keyword">AS</span> <span class="token number">a</span>\n<span class="token keyword">JOIN</span> <span class="token punctuation">`</span>student<span class="token operator">-</span>contact<span class="token operator">-</span>info<span class="token punctuation">`</span> <span class="token keyword">AS</span> <span class="token number">b</span> <span class="token keyword">ON</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID <span class="token operator">=</span> <span class="token number">b</span><span class="token punctuation">.</span>studentID<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>“Joined” data:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+------------------+--------------------+--------------------+\n| studentID | FullName               | programOfStudy   | student-phone-cell | student-US-zipcode |\n+-----------+------------------------+------------------+--------------------+--------------------+\n|         1 | Monique Davis          | Literature       | 555-555-5551       |              97111 |\n|         2 | Teri Gutierrez         | Programming      | 555-555-5552       |              97112 |\n|         3 | Spencer Pautier        | Programming      | 555-555-5553       |              97113 |\n|         4 | Louis Ramsey           | Programming      | 555-555-5554       |              97114 |\n|         5 | Alvin Greene           | Programming      | 555-555-5555       |              97115 |\n|         6 | Sophie Freeman         | Programming      | 555-555-5556       |              97116 |\n|         7 | Edgar Frank "Ted" Codd | Computer Science | 555-555-5557       |              97117 |\n|         8 | Donald D. Chamberlin   | Computer Science | 555-555-5558       |              97118 |\n+-----------+------------------------+------------------+--------------------+--------------------+</code></pre>\n      </div>\n<h3>Left Join</h3>\n<p>Using the keyword LEFT before JOIN causes the system to start with the student (LEFT) table but will return NULL from the RIGHT table if there are no rows for the LEFT table student.</p>\n<p>Note that studentID 9 appears here but the data from the contact table is just shown as NULL.</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>FullName<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>programOfStudy<span class="token punctuation">,</span>\n<span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>phone<span class="token operator">-</span>cell<span class="token punctuation">`</span><span class="token punctuation">,</span> <span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>US<span class="token operator">-</span>zipcode<span class="token punctuation">`</span>\n<span class="token keyword">FROM</span> student <span class="token keyword">AS</span> <span class="token number">a</span>\n<span class="token keyword">LEFT</span> <span class="token keyword">JOIN</span> <span class="token punctuation">`</span>student<span class="token operator">-</span>contact<span class="token operator">-</span>info<span class="token punctuation">`</span> <span class="token keyword">AS</span> <span class="token number">b</span> <span class="token keyword">ON</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID <span class="token operator">=</span> <span class="token number">b</span><span class="token punctuation">.</span>studentID<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+------------------+--------------------+--------------------+\n| studentID | FullName               | programOfStudy   | student-phone-cell | student-US-zipcode |\n+-----------+------------------------+------------------+--------------------+--------------------+\n|         1 | Monique Davis          | Literature       | 555-555-5551       |              97111 |\n|         2 | Teri Gutierrez         | Programming      | 555-555-5552       |              97112 |\n|         3 | Spencer Pautier        | Programming      | 555-555-5553       |              97113 |\n|         4 | Louis Ramsey           | Programming      | 555-555-5554       |              97114 |\n|         5 | Alvin Greene           | Programming      | 555-555-5555       |              97115 |\n|         6 | Sophie Freeman         | Programming      | 555-555-5556       |              97116 |\n|         7 | Edgar Frank "Ted" Codd | Computer Science | 555-555-5557       |              97117 |\n|         8 | Donald D. Chamberlin   | Computer Science | 555-555-5558       |              97118 |\n|         9 | Raymond F. Boyce       | Computer Science | NULL               |               NULL |\n+-----------+------------------------+------------------+--------------------+--------------------+\n9 rows in set (0.00 sec)</code></pre>\n      </div>\n<h3>Complete table listings for reference</h3>\n<p>Student table listings</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>FullName<span class="token punctuation">,</span> sat_score<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>programOfStudy<span class="token punctuation">,</span> schoolEmailAdr \n<span class="token keyword">FROM</span> student <span class="token keyword">AS</span> <span class="token number">a</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>student or LEFT table</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+-----------+------------------+------------------------+\n| studentID | FullName               | sat_score | programOfStudy   | schoolEmailAdr         |\n+-----------+------------------------+-----------+------------------+------------------------+\n|         1 | Monique Davis          |       400 | Literature       | Monique@someSchool.edu |\n|         2 | Teri Gutierrez         |       800 | Programming      | Teri@someSchool.edu    |\n|         3 | Spencer Pautier        |      1000 | Programming      | Spencer@someSchool.edu |\n|         4 | Louis Ramsey           |      1200 | Programming      | Louis@someSchool.edu   |\n|         5 | Alvin Greene           |      1200 | Programming      | Alvin@someSchool.edu   |\n|         6 | Sophie Freeman         |      1200 | Programming      | Sophie@someSchool.edu  |\n|         7 | Edgar Frank "Ted" Codd |      2400 | Computer Science | Edgar@someSchool.edu   |\n|         8 | Donald D. Chamberlin   |      2400 | Computer Science | Donald@someSchool.edu  |\n|         9 | Raymond F. Boyce       |      2400 | Computer Science | Raymond@someSchool.edu |\n+-----------+------------------------+-----------+------------------+------------------------+\n9 rows in set (0.00 sec)\n```sql\nSELECT * from `student-contact-info` AS b;</code></pre>\n      </div>\n<p>student contact or RIGHT table</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+----------------------------------+--------------------+--------------------+\n| studentID | studentEmailAddr                 | student-phone-cell | student-US-zipcode |\n+-----------+----------------------------------+--------------------+--------------------+\n|         1 | Monique.Davis@freeCodeCamp.org   | 555-555-5551       |              97111 |\n|         2 | Teri.Gutierrez@freeCodeCamp.org  | 555-555-5552       |              97112 |\n|         3 | Spencer.Pautier@freeCodeCamp.org | 555-555-5553       |              97113 |\n|         4 | Louis.Ramsey@freeCodeCamp.org    | 555-555-5554       |              97114 |\n|         5 | Alvin.Green@freeCodeCamp.org     | 555-555-5555       |              97115 |\n|         6 | Sophie.Freeman@freeCodeCamp.org  | 555-555-5556       |              97116 |\n|         7 | Maximo.Smith@freeCodeCamp.org    | 555-555-5557       |              97117 |\n|         8 | Michael.Roach@freeCodeCamp.ort   | 555-555-5558       |              97118 |\n+-----------+----------------------------------+--------------------+--------------------+\n8 rows in set (0.00 sec)</code></pre>\n      </div>\n<p>As with all of these SQL things there is MUCH MORE to them than what’s in this introductory guide.  </p>\n<p>I hope this at least gives you enough to get started.  </p>\n<p>Please see the manual for your database manager and have fun trying different options yourself.</p>',fields:{slug:"/sql/sql-joins/"},frontmatter:{title:"SQL Joins"}}},pathContext:{slug:"/sql/sql-joins/"}}}});
